import React from "react";
import GoalItem from "../GoalItem/GoalItem";
import "./GoalItemList.css";

const GoalItemList = (props) => {
  return (
    <ul className="goal-list">
      {props.items.map}
    </ul>
  );
};

export default GoalItemList;
